DROP TABLE calculos_clasificacion;

CREATE TABLE `calculos_clasificacion` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `id_fase` int(11) DEFAULT NULL,
  `id_rutina` int(11) DEFAULT NULL,
  `orden` int(11) DEFAULT NULL,
  `nota_final` float(10,4) DEFAULT NULL,
  `nota_calculada_ejecucion` float(10,4) DEFAULT NULL,
  `nota_calculada_impresion` float(10,4) DEFAULT NULL,
