  `baja` varchar(2) DEFAULT NULL,
  `preswimmer` varchar(2) DEFAULT NULL,
  `id_competicion` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=latin1;




DROP TABLE categorias;

CREATE TABLE `categorias` (
