) ENGINE=InnoDB AUTO_INCREMENT=121 DEFAULT CHARSET=latin1;




DROP TABLE clubs;

CREATE TABLE `clubs` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
