INSERT INTO paneles VALUES("1","Ejecución","5","30","EJECUCIÓN: nivel de excelencia en la realización de habilidades altamente especializadas. Ejecución de todos los movimientos.<br> SINCRONIZACIÓN: la precisión del movimiento al unísono, de las nadadoras entre sí, y el acompañamiento por encima, en y por debajo de la superficie del agua. Sincronización en el tiempo de las nadadoras entre sí y con la música.","si","1","#FFF6EC");
INSERT INTO paneles VALUES("2","Imp. Art.","5","40","COREOGRAFÍA ? la habilidad creativa de componer una rutina que combina elementos tanto artísticos como técnicos. El diseño entretejido de la variedad y creatividad de todos los movimientos.<br>\nINTERPRETACIÖN MUSICAL ? expresión del humor y talante de la música. Uso de la estructura musical.<br>\nFORMA DE PRESENTACIÓN ? la manera en la que la(s) nadadora(s) presenta la rutina al espectador. Impresión global de la rutina.","si","1","#f8d347");
INSERT INTO paneles VALUES("3","Dificultad","5","30","DIFICULTAD ? la cualidad de ser difícil de alcanzar. Dificultad de todos los movimientos y de la sincronización.","si","1","#57c8f2");
