INSERT INTO penalizaciones VALUES("1","NS18.1","En la competiciones de equipo, tanto en las eliminatorias como en las finales de Rutina Libre o de Rutina Técnica, se restará (0,5) medio punto del total de la puntuación por cada competidor que falte para completar los ocho (8) (ver la norma NS 13.1).","-0.5","");
INSERT INTO penalizaciones VALUES("2","NS18.2.1","Se supera el tiempo límite de diez (10) segundos para movimientos fuera del agua.","-1.0","");
INSERT INTO penalizaciones VALUES("3","NS18.2.2","Existe una desviación en el tiempo límite específicamente asignado a la rutina (en más o en meno","-1.0","");
INSERT INTO penalizaciones VALUES("4","NS18.2.3","Si se excede el tiempo límite de 30 segundos en el paseo hasta a la posición estática.","-1.0","");
INSERT INTO penalizaciones VALUES("5","NS18.2.4","Cada violación de la norma NS 13.2","-1.0","");
INSERT INTO penalizaciones VALUES("6","NS18.2.5","Un competidor hace uso deliberado del fondo de la piscina durante la rutina.","-1.0","");
INSERT INTO penalizaciones VALUES("7","NS18.2.6","Como se describe en la norma NS 15.3, si el acompañamiento musical falla.","-1.0","");
INSERT INTO penalizaciones VALUES("8","NS18.2.7","Un competidor hace uso deliberado del fondo de la piscina durante la rutina paraINSERT INTO penalizaciones VALUES("9","NS18.2.8","Una rutina es interrumpida, por un competidor, durante los movimientos en tierra y se autoriza una nueva salida.","-2.0","");
INSERT INTO penalizaciones VALUES("10","NS18.2.9","Si durante los movimientos en la plataforma de salida, los competidores ejecutan apilamientos, torres o pirámides humanas.","-2.0","");
INSERT INTO penalizaciones VALUES("11","NS18.3","Se restará medio (0,5) punto de la nota de Ejecución por cada falta los elementos obligatorios 6 y 7 en Dúo y en los elementos obligatorios 6 y 7 en Equipo del Apéndice VI.","-0.5","");
INSERT INTO penalizaciones VALUES("12","NS18.4","Si uno (o más) competidor(es) deja(n) de nadar antes de que la rutina finalice, la rutina será descalificada. Si la parada está causada por circunstancias ajenas al control del competidor(es), el Juez Arbitro autorizará que la rutina vuelva a realizarse durante la competición.","-0.5","");
INSERT INTO penalizaciones VALUES("13","NS18.5.1","Se restarán dos (2) puntos del resultado de la rutina por cada elemento obligatorioINSERT INTO penalizaciones VALUES("14","NS 11.1.1","Si un competidor se para voluntariamente y solicita hacer la figura de nuevo.","-2.0","");
INSERT INTO penalizaciones VALUES("15","NS 11.1.2","Si un competidor no realiza la figura anunciada, o si la figura realizada no tiene todos los elementos obligatorios, el Juez Árbitro o su Ayudante avisará a los jueces y al competidor. El competidor tendrá otra oportunidad para realizar la Figura anunciada.","-2.0","No realiza figura anunciada y repite");
